          "stringValue": "The Bachelor of Science in Development Economics undergraduate program focuses on applying economic theory and principles to the development challenges faced by low- and middle-income countries. The program equips students with the knowledge and skills needed to analyze and address issues such as poverty, inequality, sustainable development, and economic growth, particularly in developing economies.\nKey areas of study include development theory, poverty and inequality analysis, economic growth, policy design for development, international trade, rural development, environmental economics, microfinance, and the role of institutions in development. Students also learn about the impact of globalization, foreign aid, and the economics of education, health, and infrastructure on development.\nGraduates are prepared for careers in development agencies, international organizations, government policy departments, NGOs, and research institutions. They can work as development economists, policy analysts, project managers, economic advisors, and researchers focused on development issues. The program also offers a strong foundation for further studies in economics, international development, public policy, or sustainable development."
