        "description": {
          "stringValue": "This programme is designed to give students the knowledge and skills they need to monitor community health, design and implement policies that promote health, evaluate health services, and eliminate health disparities. What sets this programme apart is its practical approach. Not only will you learn about health promotion and disease prevention strategies, but you will also gain hands-on experience in core professional areas, including communicable and non-communicable diseases prevention/control, environmental and occupational health, and health promotion and education. Classes are scheduled for daytime, evening and weekend programmes, so you can study full-time or further your education while maintaining your current employment. Admission to the programme requires applicants to have either direct entry, a diploma in Health Sciences or other allied health courses, or International school leaving certificate qualifications. If you are from a non-English-speaking country, you will need to pass an English aptitude test as part of your admission requirements. Upon graduation, you will be well-equipped to diagnose and investigate community health problems, design and manage health education and promotion programmes, provide professional preventive health services, and mobilize and sensitize the general public on national and international policies and strategies for improved health and well-being for all. You'll also have the skills to design, conduct, analyze, and interpret results of Public Health research to initiate evidence-based interventions. This programme opens doors to a wide range of career opportunities, including public health policy analyst, health program manager, public health consultant, epidemiologist, health educator, health communications specialist, and community health worker."
        }
