        "name": {
          "stringValue": "Bachelor Of Primary Education (Inservice)"
        },
        "description": {
          "stringValue": "The Bachelor of Primary Education is an undergraduate degree programme for three years that focuses on preparing you to become a teacher specifically for primary school-aged children, typically ranging from ages 5 to 12. This programme is designed to provide you with the knowledge, skills, and practical experience necessary to create engaging and effective learning environments for young learners. The curriculum of the Bachelor of Primary Education programme combines a balance of general education courses, core education coursework, and practical teaching experiences. The programme typically spans three years of FULL-TIME study OR IN-SERVICE; depending on the Applicant's choice. In the general education courses, you will develop your foundational knowledge in subjects such as mathematics, integrated science, language arts, social studies, early childhood education, and physical education. These courses aim to provide you with a broad understanding of the subjects taught in primary schools and help you develop your own subject matter expertise. The core education coursework focuses on the theories and principles of education, psychology, curriculum, philosophy, child development, instructional strategies, classroom management, assessment and evaluation, and inclusive education practices. These courses will provide you with a deep understanding of the principles of effective teaching and learning, as well as the specific needs of primary school learners. In addition to the theoretical coursework, you will engage in practical teaching experiences throughout the Bachelor of Primary Education programme. These experiences may include observation and participation in primary school classrooms, supervised teaching practicums, and internships. These practical experiences will allow you to apply your knowledge in real-world settings, develop your teaching skills, and gain valuable hands-on experience working with young learners. Throughout the programme, you will also have opportunities to specialize in specific areas of interest, such as early childhood education, literacy education, mathematics education, or special education. These specializations will allow you to develop a deeper understanding of specific teaching methodologies and strategies relevant to your chosen focus area. Upon completion of the Bachelor of Primary Education programme, you will be prepared to pursue a career as a primary school teacher in both public and private schools. You will be equipped with the knowledge and skills to effectively plan and deliver instruction, manage classrooms, assess student learning, and support the holistic development of young learners."
        },
