          "stringValue": "The BSc. in Oil, Gas and Energy Management provides a broad training in Oil, Gas and Energy industry matters; especially those pertaining to how small oil companies can work with National Oil Companies (NOCs) and energy ministries to better exploit hydrocarbon resources. In this respect training in commercialization strategies, economics and law will be important, as will an understanding of how science and technology can be applied to improve hydrocarbon exploration success and recovery in a sustainable manner.\nThe course addresses Oil, Gas and Energy from the business administration and management perspective. Adding to the uniqueness of this three-year programme is the incorporation of at least two (2) month field placements at the end of each of the first two years of study.\nThe first year offers fundamental academic grounding in business, accounting, economics, law and petroleum geosciences studies, whereas the second and third years of the programme feature courses that are specifically-tailored to fit the needs of the Oil, Gas and Energy business."
