          "stringValue": "The Bachelor of laws Programme at KCU emphasizes a culture of thinking critically, facilitating advocacy, promote awareness of legal entitlement to both substantive and participatory justice, good health practice and research. It will support strong family values in the community and the world at large. We are particularly proud of our practical skills approach demonstrated through student participation in moots, clinical legal education, field attachments and our collaborative Memorandum of Understanding (MOUs) with various law firms and governmental institutions including the Office of the Director of Public Prosecution.\nThe law graduate will not only be in position to positively impact societal experiences but also go a long way in using principles from both substantive and procedural laws in settling of disputes strengthening the profession. This curriculum reflects the accepted and expected standards for legal training and legal education as set out by the ULC in conjunction with the National Council for Higher Education (NCHE)."
